import React, { useEffect } from 'react'
import { sumid } from '../components/Refugeecard'

function Refugeeq(prop) {

  
  useEffect(()=>{
    const id = sumid();
  },[])
  return (
    <div>
       <h1>{id}</h1>
       <h1>{prop.id}</h1>
    </div>
  )
}

export default Refugeeq
